import java.io.ByteArrayOutputStream;
import java.util.zip.GZIPInputStream;


summaryMessage = ""

timeout = $[TIMEOUT]*60

sleepTime = 5000 // 5 seconds
sleepTimeInSec = sleepTime.intdiv(1000)
maxretries = timeout.intdiv(sleepTimeInSec)

retries = maxretries

finishedStates = [ "SUCCEEDED", "FAILED", "CANCELED" ]

endpoint = "runs"
finished = 0;

summaryMessage = summaryMessage + "Monitoring job status : \n"
summaryMessage = summaryMessage + "================================================= \n"

while(finished == 0 && retries > 0) {

    if (retries == maxretries) { 
      monitorRunResponse = send_request(endpoint, "GET", "", runOCID)
    } else {
      monitorRunResponse = send_request(endpoint, "GET", "", runOCID, false)
    }

    monitorRunResponseBody = getBody(monitorRunResponse)

    if (retries == maxretries) { 

      summaryMessage = summaryMessage + "Response : \n" 
      summaryMessage = summaryMessage + monitorRunResponse.getStatus() + " : "+ monitorRunResponse.getStatusInfo().getReasonPhrase() + "\n"   

      summaryMessage = summaryMessage + "Response body : \n" 
      summaryMessage = summaryMessage + monitorRunResponseBody + "\n\n"
    }

    if (monitorRunResponse.getStatus() == 200) {

        monitorRunResponseBodyJson = jsonSlurper.parseText(monitorRunResponseBody)
        status = monitorRunResponseBodyJson.lifecycleState
        statusDetails = monitorRunResponseBodyJson.lifecycleDetails

        // summaryMessage = summaryMessage + "Status : " + status + "\n\n"
        println "Status : " + status 

        if(finishedStates.contains(status)) {
            finished = 1;
            summaryMessage = summaryMessage + "Response : \n" 
            summaryMessage = summaryMessage + monitorRunResponse.getStatus() + " : "+ monitorRunResponse.getStatusInfo().getReasonPhrase() + "\n"   

            summaryMessage = summaryMessage + "Response body : \n" 
            summaryMessage = summaryMessage + monitorRunResponseBody + "\n\n"
        } else {
            retries--;
            sleep(sleepTime);
        }
    } else {   
        summaryMessage = summaryMessage + "Response : \n" 
        summaryMessage = summaryMessage + monitorRunResponse.getStatus() + " : "+ monitorRunResponse.getStatusInfo().getReasonPhrase() + "\n"   

        summaryMessage = summaryMessage + "Response body : \n" 
        summaryMessage = summaryMessage + monitorRunResponseBody + "\n\n"
        odiRef.setSummaryMessage(summaryMessage)

        String errorMessage = "Monitor job rest call failed with " + monitorRunResponse.getStatus() + " : "+ monitorRunResponse.getStatusInfo().getReasonPhrase() + ", check task log for errors."
        throw new OdiKMException (errorMessage);   
    }
}

if (finished == 0 && retries == 0) {
    odiRef.setSummaryMessage(summaryMessage)
    throw new OdiKMException ("Monitor job timed out.");
}

summaryMessage = summaryMessage + "Run : " + monitorRunResponseBodyJson.displayName + " ended in ${monitorRunResponseBodyJson.runDurationInMilliseconds} ms. \n"
summaryMessage = summaryMessage + "Status : " + status + "\n"
