  reponse = "";
  InputStream responseBody;
  GZIPInputStream gis;
  ByteArrayOutputStream out;

  try {
    responseBody = (InputStream) getLogResponse.getEntity();
    gis = new GZIPInputStream(responseBody);
    out = new ByteArrayOutputStream(); 
    byte[] buffer = new byte[1024];
    int len;
    while ((len = gis.read(buffer)) > 0) {
      out.write(buffer, 0, len);
    }
    response = out.toString("UTF-8");
  } finally {
    responseBody.close();
    gis.close();
    out.close();
  }
  summaryMessage = summaryMessage + "Response body : \n"
  summaryMessage = summaryMessage + response + "\n\n"

  if (getLogResponse.getStatus() != 200) {
      odiRef.setSummaryMessage(summaryMessage)
      throw new OdiKMException ("Get log call failed, check task log for errors.");  
  } 
}

