// Pre-Requirement: Allow setting of restricted headers. This is required to allow the SigningFilter
// to set the host header that gets computed during signing of the request.
System.setProperty("sun.net.http.allowRestrictedHeaders", "true");

dataflow_endpoint = "$[dataflow_endpoint]"
dataflow_rest_version = "$[dataflow_rest_version]"

summaryMessage = ""

jsonSlurper = new JsonSlurper()

def send_request(endpoint, method, payload, url_params, logRequestInfo = true) {
    // 1) Create a request signing filter instance
    RequestSigningFilter requestSigningFilter = RequestSigningFilter.fromConfigFile(configurationFilePath, profile);

    // 2) Create a Jersey client and register the request signing filter
    Client client = ClientBuilder.newBuilder().build().register(requestSigningFilter);

    // 3) Target an endpoint. You must ensure that path arguments and query
    // params are escaped correctly yourself
    WebTarget target =
    client.target(dataflow_endpoint)
    .path(dataflow_rest_version)
    .path(endpoint)
    .path(UrlEscapers.urlPathSegmentEscaper().escape(url_params));

    if (logRequestInfo) {
      summaryMessage = summaryMessage + method + " : " + target.getUri() + "\n\n"
      if (method == "POST") {
        summaryMessage = summaryMessage + "Request payload : \n"  
        summaryMessage = summaryMessage + payload + "\n\n"
      }
    }

    // 4) Set the expected type and invoke the callsend
    Invocation.Builder ib = target.request();
    ib.accept(MediaType.WILDCARD_TYPE);
    def response;
    if (method == "POST") {
        response = ib.post(Entity.json(payload));
    } else if (method == "DELETE") {
        response = ib.delete();
    } else {
        response = ib.get();
    }

    return response;
}

def getBody(resp) {
    InputStream responseBody = (InputStream) resp.getEntity();
    BufferedReader reader = new BufferedReader(new InputStreamReader(responseBody, StandardCharsets.UTF_8));

    StringBuilder jsonBody = new StringBuilder();
    String line;
    while ((line = reader.readLine()) != null) {
        jsonBody.append(line);
    }
    return jsonBody.toString();
}

def getHeaders(resp) {
    MultivaluedMap<String, Object> responseHeaders = response.getHeaders();
    return responseHeaders;
}


